import React from 'react'

const StartForm = (props) => {
  return (
    <div>
        <form action="">
            <select name="" id="" value={props.category}>
                {props.categories.map((category)=>{
                    return(
                        <option key={category.id} value={category.id}>{category.name}</option>
                    )
                })}
            </select>
        </form>
    </div>
  )
}

export default StartForm
